INSERT INTO tutors VALUES (1,'Nữ','1998','Công nghệ thông tin','Đại học sư phạm kỹ thuật Tp. HCM','2020',NULL,'Sinh viên',150000,'0',2),
(2,'Nữ','1998','CNTT','Đại học sư phạm kỹ thuật TP. HCM','2020',NULL,'Sinh viên',100000,'0',3),
(3,'Nữ','1999','Kinh doanh quốc tế','Đại học sư phạm kỹ thuật Tp. HCM','2021',NULL,'Sinh viên',130000,'0',4),
(4,'Nữ','1996','Kinh tế','Đại học ngân hàng Tp. HCM','2018','Đã có JLPT N2.Mặc dù chưa có kinh nghiệm giảng dạy nhưng trong lớp, tôi thường hướng dẫn bài cho bạn bè và thường xuyên thuyết trình tiếng nhật trên lớp','Cử nhân',220000,'0',5),
(5,'Nam','1997','Kỹ thuật phục hình răng','Đại Học Y Dược','2020','Nhiệt tình, chịu khó','Sinh viên',120000,'0',6),
(6,'Nam','1982','Sư phạm Tiếng Anh','Đại Học Sư Phạm HCM','2011',' CÓ 7 NĂM KINH NGHIỆM','Giáo viên',200000,'0',7),
(7,'Nữ','2000','Quản Trị Kinh Doanh','Đại Học Kinh Tế','2022',NULL,'Sinh viên',100000,'0',8),
(8,'Nữ','1995','Sư phạm Hóa học','Đại Học An Giang','2017','Tôi có 1 năm kinh nghiệm đứng lớp và 3 năm kinh nghiệp gia sư. Tôi luôn nhiệt huyết với việc giảng dạy và có phương pháp phù hợp vố việc phát triển của từng em học sinh.','Giáo viên',250000,'0',9),
(9,'Nam','1988','Ngôn ngữ Anh','Đại học sư phạm tp. HCM','2011',' 10 năm kinh nghiệm dạy kèm, 5 năm kinh nghiệm giao tiếp. Hiện là giảng viên đại học Giao Thông Vận Tải TPHCM','Giáo viên',220000,'0',10),
(10,'Nam','1995','Xây Dựng','Đại Học Tôn Đức Thắng','2018',' Là sinh viên Giỏi tại trường.  Giọng nói rõ ràng dễ nghe, đã từng dạy kèm nhiều lớp Toán.','Cử nhân',230000,'0',11),
(11,'Nam','1999','Nhật Bản Học',' Đại Học Ngoại Ngữ Tin Học','2021','Giọng nói rõ ràng dễ nghe, đã từng dạy kèm nhiều lớp tiếng Nhật','Sinh viên',150000,'0',12),
(12,'Nam','2001','Luật dân sự','Đại Học Luật HCM','2022',NULL,'Sinh viên',140000,'0',13),
(13,'Nam','1995','Ngôn Ngữ Anh','Đại Học Công Nghiệp','2019',NULL,'Cử nhân',200000,'0',14),
(14,'Nữ','2000','Luật Quốc Tế','Đại Học Luật','2022','Siêng năng , có trách nhiệm , chăm chỉ trong công việc, có kinh nghiệm giảng dạy','Sinh viên',150000,'0',15),
(15,'Nữ','1992','Sư phạm Tiếng Anh','Đại Học Sư Phạm HCM','2016','Chuyên môn vững, có kinh nghiệm','Thạc sĩ',300000,'0',16),
(16,'Nữ','1989','Khúc Xạ Nhãn Khoa','Đại Học Y Khoa Phạm Ngọc Thạch HCM','2015','3 năm ôn thi đại học cho học sinh 12 (toán, hóa, sinh). 2 năm Kinh nghiệm luyện thi toán, hóa cho học sinh lớp 9. Nhiệt tình, tỉ mỉ.','Thạc sĩ',320000,'0',17),
(17,'Nữ','2001','Công nghệ thông tin','Đại học sư phạm kỹ thuật Tp. HCM','2022','Có gần 2 năm kinh nghiệm dậy kèm tại nhà. Hòa đồng, thân thiện với học sinh, lun nhận được sự tin yêu và kinh trọng của phụ huynh','Sinh viên',150000,'0',18),
(18,'Nam','1995','Kinh doanh quốc tế','Đại học sư phạm kỹ thuật Tp. HCM','2018','có 4 năm kinh nghiệm dạy tại trường, trung tâm và dạy kèm.','Cử nhân',200000,'0',19),
(19,'Nữ','1999','Sư Phạm Toán học','Đại Học Sư Phạm HCM','2020','Hơn 3 năm kinh nghiệm dạy kèm đảm bảo chất lượng, tận tình giảng dạy cho học sinh tiếp thu bài tốt','Sinh viên',100000,'0',20);
